import React from 'react'
import { useQuery, gql } from '@apollo/client'

const products = gql`
  query getProducts {
    products {
      name
      description
      image
      slug
    }
  }
`

export default function StoreFront() {
  const { loading, error, data } = useQuery(products)

  if(loading) return <p>Loading...</p>
  if(error) return <p>{error}</p>

  console.log(data)

  return (
    <div>
      <h1>Store</h1>
    </div>
  )
}
